description:
During the Tribulation, we read of those in REVELATION 16 who blaspheme the Lord and refuse to repent. Throughout Scripture, we see willful rebellion results in a pattern of discipline, punishment, and finally judgement. Therefore, gain the wisdom of a spanking, applicable in rearing children. So too applies the proverbial spankings throughout life. Repent, and run to the open arms of the Savior, Jesus Christ.
Athey Creek Christian Fellowship is a body of believers in Wilsonville Oregon desiring to know the Lord in an ever-increasing measure. We are a non- denominational fellowship associating with all who are in the Body of Christ.  
